import logo from './logo.svg';
import './App.css';

function App() {

  async function test(){
    fetch("/foo2").then((res) => console.log(res.json().res));  
  }

  return (
    <div className="App">
      <button onClick={() => test()}>Click Me</button>
    </div>
  );
}

export default App;
